import React from "react";
import {
  View,
  Text,
  StyleSheet,
  FlatList,
  TouchableOpacity,
} from "react-native";
import ResultsDetail from "./ResultsDetails";

const ResultsList = ({navigation}) => {
  const results = [
    { Title: "Batman: Gotham City Racer",
    Year: "2001",
    imdbID: "tt0281642",
    Type: "game",
    Poster: "https://m.media-amazon.com/images/M/MV5BZjk2OGQ0YWYtMTBjNC00NTRiLWIxMDAtZDdiOTgyYjgwNzZiXkEyXkFqcGdeQXVyNDQ2OTk4MzI@._V1_SX300.jpg" },
    {
        Title: "Marvel vs. DC: At the Movies",
        Year: "2015–",
        imdbID: "tt9253268",
        Type: "series",
        Poster: "https://m.media-amazon.com/images/M/MV5BOTM4OGJjYjQtZDkzZC00Nzk3LWE0ZDItYTY2NDg5NTlhNDFiXkEyXkFqcGdeQXVyNDUyNjI1MA@@._V1_SX300.jpg"
    },
  ];
  return (
    <View>
    <Text>Search Result:</Text>
      <FlatList
        data={results}
        keyExtractor={(result) => result.imdbID}
        renderItem={({ item }) => {
          return (
              <ResultsDetail result={item} />
          );
        }}
      />
    </View>
  );
};

export default ResultsList;
